import React from "react";
import NavBar from "../../components/NavBar/NavBar";
import "./Home.css";

const Home = () => {
  return (
    <div className="container">
      <button>Login</button>
      <button>Register</button>
      <h1>Booking Website</h1>
      <NavBar></NavBar>
    </div>
  );
};

export default Home;
